import { useEffect, useState } from 'react';

function Landing(){
    const [data, setData] = useState({})

    useEffect(()=> {
        fetch(`http://localhost:3000/articles`)
            .then(response => response.json())
            .then(returnedData => {
                setData(returnedData)
            })
    }, [])

    const itemArray = data.map((item)=> {
        console.log(item)
    })

    return (
        <>
            <h1>{itemArray}</h1>
        </>
    )
}

export default Landing
